import React, { Component } from "react";

class MemeGenerator extends Component {
  constructor() {
    super();
    this.state = {
      topText: "",
      bottomText: "",
      allMemeImage: [],
    };
  }
  componentDidMount() {
    fetch("http://api.imgflip.com/get_memes")
      .then((response) => response.json())
      .then((response) => {
        const { memes } = response.data;
      });
  }
  render() {
    return (
      <div>
        <h1>MemeGenerator</h1>
      </div>
    );
  }
}

export default MemeGenerator;
